{ "type": "Feature", "properties": { "Name": "Fort Bridger", "Description": "Fort Bridger State Historic Site<br><br><img src=\"http:\/\/upload.wikimedia.org\/wikipedia\/en\/thumb\/c\/ce\/Fort_Bridger_on_the_Green_River.jpg\/250px-Fort_Bridger_on_the_Green_River.jpg\"\/><br> In the summer of 1842, mountain man Jim Bridger announced that he was building a trading post, \"...in the road of the emigrants on Black's Fork of the Green River.\" From its beginnings as a log and mud trading post, Bridger's \"fort\" matured into a modern frontier military post before the days of the covered wagon emigration were over. A very successful ranching operation grew around the Fort under the direction of Post Sutler Judge William A. Carter. With the ranch came settlement and, eventually, the town of Fort Bridger, the only community in Wyoming with direct roots to the earliest days of the Oregon Trail. Today Fort Bridger is operated by the State of Wyoming as an historical attraction. (In the town of Fort Bridger on I-80 Business Loop.) <br><br> Source BLM <br><br> <a href=\"http:\/\/wyoparks.state.wy.us\/Site\/SiteInfo.aspx?siteID=17\">http:\/\/wyoparks.state.wy.us\/Site\/SiteInfo.aspx?siteID=17<\/a>" }, "geometry": { "type": "Point", "coordinates": [ -110.391756, 41.317630, 0.000000 ] } }
