{ "type": "Feature", "properties": { "Name": "Ayres Natural Bridge", "Description": "Ayres Natural Bridge Landmark<br><br> <img src=\"http:\/\/www.blm.gov\/pgdata\/etc\/medialib\/blm\/wy\/programs\/historictrails\/mo-pics.Par.5283.Image.140.138.1.gif\"\/><br><br> Although located about a mile south of the trail, the Natural Bridge was often visited by emigrants. It was, perhaps, Wyoming's first tourist attraction. An 1843 pioneer described it as, \"...a natural bridge of solid rock, over a rapid torrent, the arch being regular as tho' shaped by art....\" The stream, originally known as Bridge Creek, is now called LaPrele Creek and flows through a beautiful public park surrounding the Bridge. (11 miles west of Douglas on I-25 to Natural Bridge Exit, then 5 miles south.)<br><br> Source BLM" }, "geometry": { "type": "Point", "coordinates": [ -105.611874, 42.734313, 0.000000 ] } }
