{ "type": "Feature", "properties": { "Name": "Portland", "Description": "Portland early history:<br><br><img src=\"http:\/\/upload.wikimedia.org\/wikipedia\/commons\/thumb\/5\/50\/Portland_Oregon_in_1853.jpg\/220px-Portland_Oregon_in_1853.jpg\"\/><br><br> The site of the future city of Portland, Oregon, was known to American, Canadian, and British traders, trappers and settlers of the 1830s and early 1840s as \"The Clearing,\"[citation needed] a small stopping place along the west bank of the Willamette River used by travelers en route between Oregon City and Fort Vancouver. As early as 1840, Massachusetts sea captain John Couch logged an encouraging assessment of the rivers depth adjacent to The Clearing, noting its promise of accommodating large ocean-going vessels, which could not ordinarily travel up-river as far as Oregon City, the largest Oregon settlement at the time. In 1843, Tennessee pioneer William Overton and Asa Lovejoy, a lawyer from Boston, Massachusetts, filed a 640 acres (260 ha) land claim with Oregon's provisional government that encompassed The Clearing and nearby waterfront and timber land. Legend has it that Overton had prior rights to the land but lacked funds, so he agreed to split the claim with Lovejoy, who paid the 25-cent filing fee[citation needed]. Portland in 1853. <br><br> Bored with clearing trees and building roads, Overton sold his half of the claim to Francis W. Pettygrove of Portland, Maine, in 1845.[citation needed] When it came time to name their new town, Pettygrove and Lovejoy both had the same idea: to name it after his home town. They flipped a coin to decide, and Pettygrove won. On November 1, 1846, Lovejoy sold his half of the land claim to Benjamin Stark, as well as his half-interest in a herd of cattle for $1,215. <br><br> Three years later, Pettygrove had lost interest in Portland and become enamored with the California Gold Rush. On September 22, 1848, he sold the entire townsite, save only for 64 sold lots and two blocks each for himself and Stark, to Daniel H. Lownsdale, a tanner. Although Stark owned fully half of the townsite, Pettygrove \"largely ignor[ed] Stark's interest\", in part because Stark was on the east coast with no immediate plans to return to Oregon. Lownsdale paid for the site with $5,000 in leather, which Pettygrove presumably resold in San Francisco for a large profit. <br><br> On March 30, 1849, Lownsdale split the Portland claim with Stephen Coffin, who paid $6,000 for his half. By August 1849, Captain John Couch and Stark were pressuring Lownsdale and Coffin for Stark's half of the claim; Stark had been absent, but was using the claim as equity in an East Coast-California shipping business with the Sherman Brothers of New York. <br><br> In December 1849, William W. Chapman bought what he believed was a third of the overall claim for $26,666, plus his provision of free legal services for the partnership.[citation needed] In January 1850, Lownsdale had to travel to San Francisco to negotiate on the land claim with Stark, leaving Chapman with power of attorney. Stark and Lownsdale came to an agreement on March 1, 1850, which gave to Stark the land north of Stark Street and about $3,000 from land already sold in this area. This settlement reduced the size of Chapman's claim by approximately 10%. Lownsdale returned to Portland in April 1850, where the terms were presented to an unwilling Chapman and Coffin, but who agreed after negotiations with Couch. While Lownsdale was gone, Chapman had given himself block 81 on the waterfront and sold all of the lots on it, and this block was included in the Stark settlement area. Couch's negotiations excluded this property from Stark's claim, allowing Chapman to retain the profits on the lot. <br><br> Portland existed in the shadow of Oregon City, the territorial capital 12 miles (19 km) upstream at Willamette Falls. However, Portland's location at the Willamette's confluence with the Columbia River, accessible to deep-draft vessels, gave it a key advantage over the older peer.[citation needed] It also triumphed over early rivals such as Milwaukie and Linnton. In its first census in 1850, the city's population was 821 and, like many frontier towns, was predominantly male, with 653 male whites, 164 female whites and four \"free colored\" individuals. It was already the largest settlement in the Pacific Northwest, and while it could boast about its trading houses, hotels and even a newspaperthe Weekly Oregonianit was still very much a frontier village, derided by outsiders as \"Stumptown\" and \"Mudtown.\"[citation needed] It was a place where \"stumps from fallen firs lay scattered dangerously about Front and First Streets  humans and animals, carts and wagons slogged through a sludge of mud and water  sidewalks often disappeared during spring floods.  Source Wikipedia<br><br>" }, "geometry": { "type": "Point", "coordinates": [ -122.660809, 45.503241, 0.000000 ] } }
